                    int index = 0;

                    _context._tenant = 1;

                    foreach (var posttd in postsTodoDeporte)
                    {

                        PostModel newPost = _mapper.Map<PostModel>(posttd);
                        UserModel userExist = _context.User.Where(x => x.UserName == usersTd.ElementAt(index)).FirstOrDefault();

                        newPost.UserOwner = userExist;
                        newPost.Created = DateTime.Now;
                        newPost.Active = true;
                        newPost.isSanctioned = false;
                        newPost.PendingToReview = false;
                        newPost.alreadyModerated = false;
                        newPost.TenantInstanceId = 1;

                        _context.Add(newPost);
                        _context.SaveChanges();

